0.html.body:
소개
네이버 지도 SDK는 네이버 지도 앱을 비롯한 네이버의 여러 서비스에서 사용 중인 지도 엔진입니다. 대규모 사용자가 이용하는 서비스에 다년간 적용되어 기능과 안정성이 보장됩니다. 또한 개발자 친화적인 API를 제공하므로 SDK가 제공하는 강력한 기능을 쉽게 사용할 수 있습니다.
강력한 기능
네이버 지도 SDK는 네이버 지도같은 복잡한 서비스에서 요구되는 다양한 기능을 모두 수용하는 강력한 기능을 제공합니다.
풀 벡터 렌더링
모든 화면을 풀 벡터 렌더링하므로 지도를 확대하더라도 뭉개지는 현상이 일어나지 않습니다. 지도를 기울이거나 회전하더라도 항상 최적의 심벌이 서로 겹치지 않게 배치되며 정면을 향해 렌더링됩니다. 화면에 디스플레이되는 각종 속성을 동적으로 변경할 수도 있습니다.

다양한 지도 유형과 레이어
일반 지도, 위성 지도, 위성 겹쳐보기 지도, 지형도, 내비게이션 지도 등 다섯 가지의 배경 지도 유형을 제공합니다. 또한 건물, 실시간 교통정보, 대중교통, 자전거, 등산로, 지적편집도 등 여섯 가지의 레이어 그룹을 배경 지도와 함께 표현할 수 있습니다. 실내지도 기능도 빌트인으로 제공하며, 내비게이션용 야간 모드도 지원합니다.

다양한 오버레이
마커, 정보 창, 바닥 오버레이, 셰이프 등 널리 사용되는 오버레이는 물론, 위치, 경로선, 화살표 등 특화된 오버레이도 다수 제공합니다. 특히 마커는 캡션, 서브 캡션, 겹침 제어 등 강력한 기능을 제공합니다.

자연스러운 제스처
지도를 조작하는 사용자의 손가락을 정확히 따라가는 자연스러운 제스처 조작을 지원합니다. 스크롤, 핀치 등 기본적인 제스처 외에도 더블 탭, 두 손가락 탭, 한 손가락 줌 등 편리한 제스처를 제공합니다. 모든 제스처 조작에는 미세하기 조정된 관성 효과가 동반되며, 관성 효과를 개발자가 직접 조정할 수도 있습니다.
강력한 이벤트 시스템
오버레이, 지도뿐만 아니라 각 심벌도 탭할 수 있고 이벤트를 받을 수 있습니다. 또한 이벤트 핸들러를 등록하지 않으면 덮힌 요소가 이벤트를 받고, 이벤트를 소비하지 않으면 지도로 이벤트가 전파되는 등 진보한 이벤트 전파 시스템을 사용합니다.
쉬운 개발
네이버 지도 SDK는 개발자 친화적이고 직관적인 API를 제공하므로 SDK를 사용한 앱을 개발하기 쉽습니다.
Swift 호환
모든 API에 널 가능성 애너테이션이 붙어 있고 속성(property)의 명칭이 일관적으로 부여되어 있어 Swift 프로젝트에서도 잘 호환됩니다.
현대적인 API
불변 객체, 열거형 사용 등 최신 API 패러다임을 적용해 코드가 간결하고 직관적입니다.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.reason = 3
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 2
naverMap.moveCamera(cameraUpdate, completion: { (isCancelled) in
    if isCancelled {
        print("카메라 이동 취소")
    } else {
        print("카메라 이동 성공")
    }
})





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.reason = 3
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 2
naverMap.moveCamera(cameraUpdate, completion: { (isCancelled) in
    if isCancelled {
        print("카메라 이동 취소")
    } else {
        print("카메라 이동 성공")
    }
})




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.reason = 3;
cameraUpdate.animation = NMFCameraUpdateAnimationFly;
cameraUpdate.animationDuration = 2;
[naverMap moveCamera:update completion:^(bool isCancelled) {
    if (isCancelled) {
        NSLog(@"카메라 이동 취소");
    } else {
        NSLog(@"카메라 이동 성공");
    }
}];






직관적인 API
객체가 필요하면 생성하고, 이벤트 처리가 필요하면 그 객체에 이벤트 핸들러를 달면 되는 등 직관적으로 예상할 수 있는 형태의 API 구조를 갖추고 있습니다.


    Swift
    Objective-C




        let marker = NMFMarker(position: NMGLatLng(lat: 37.5670135, lng: 126.9783740))
marker.touchHandler = { (overlay) in
    print("마커 클릭됨")
    return true
}
marker.mapView = naverMap;





        Swift

          let marker = NMFMarker(position: NMGLatLng(lat: 37.5670135, lng: 126.9783740))
marker.touchHandler = { (overlay) in
    print("마커 클릭됨")
    return true
}
marker.mapView = naverMap;




        Objective-C

          NMFMarker marker = [NMFMarker markerWithPosition:NMGLatLngMake(37.5670135, 126.9783740)];
marker.touchHandler = ^BOOL(NMFOverlay *overlay) {
    NSLog(@"마커 클릭됨");
    return YES;
};
marker.mapView = naverMap;






양질의 문서와 데모 앱
개발 가이드, API 레퍼런스, 데모 앱 등 다양하고 수준 높은 자료가 제공되어 개발에 참고할 수 있습니다.

2-1.html.body:
지도 객체
하나의 지도는 뷰 요소와 인터페이스 요소로 구성됩니다. 뷰 요소는 화면에 지도를 나타내는 역할을 하며, NMFMapView가 여기에 해당합니다. 지도를 다루는 인터페이스 역할을 하는 인터페이스 요소는 NMFNaverMapView 클래스가 담당하며, 지도와 관련된 주요 UI 기능 대부분을 이 클래스에서 제공합니다.
지도 화면은 뷰로 제공됩니다. NMFMapView 혹은 NMFNaverMapView를 뷰 컨트롤러에 추가하면 화면에 지도가 나타납니다.
NMFMapView
뷰 컨트롤러에 MapView를 서브 뷰로 추가하면 지도가 화면에 나타납니다. NMFMapView는 지도를 단순히 화면에 보여주는 역할만 담당합니다. 
다음은 뷰 컨트롤러에 NMFMapView를 추가해 지도를 화면에 나타내는 예제입니다.


    Swift
    Objective-C




        override func viewDidLoad() {
    super.viewDidLoad()

    let mapView = NMFMapView(frame: view.frame)
    view.addSubview(mapView)
}





        Swift

          override func viewDidLoad() {
    super.viewDidLoad()

    let mapView = NMFMapView(frame: view.frame)
    view.addSubview(mapView)
}




        Objective-C

          - (void)viewDidLoad {
    [super viewDidLoad];

    NMFMapView *mapView = [[NMFMapView alloc] initWithFrame:self.view.frame];
    [self.view addSubview:mapView];
}






XIB나 storyboard 등의 Interface Builder를 사용한다면 UIView를 추가하고 Custom Class로 NMFMapView를 지정합니다.

NMFNaverMapView
NMFNaverMapView를 추가해서 지도를 화면에 나타낼 수도 있습니다. NMFNaverMapView에는 지도에 필요한 기본적인 UI가 구현돼 있으므로 보다 쉽게 지도 앱을 구현할 수 있습니다.
기본적인 추가 방법은 NMFMapView와 동일합니다.


    Swift
    Objective-C




        override func viewDidLoad() {
    super.viewDidLoad()

    let naverMapView = NMFNaverMapView(frame: view.frame)
    view.addSubview(naverMapView)
}





        Swift

          override func viewDidLoad() {
    super.viewDidLoad()

    let naverMapView = NMFNaverMapView(frame: view.frame)
    view.addSubview(naverMapView)
}




        Objective-C

          - (void)viewDidLoad {
    [super viewDidLoad];

    NMFNaverMapView *naverMapView = [[NMFNaverMapView alloc] initWithFrame:self.view.frame];
    [self.view addSubview:naverMapView];
}

2-2.html.body:
좌표 객체
좌표는 카메라나 오버레이의 위치같은 지리적 정보를 표현하기 위한 최소 단위로, 지도를 구성하는 가장 기본적인 요소입니다. 지도와 관련된 많은 API는 좌표 또는 영역을 파라미터로 받거나 반환합니다.
좌표
네이버 지도 SDK는 지구 표면의 한 지점을 위도와 경도로 표현하는 지리 좌표계를 기본 좌표계로 사용하며, 이와 관련된 기능을 제공합니다. 또한 기본 좌표계로 변환할 수 있는 몇 가지 다른 좌표계도 제공합니다.
NMGLatLng
NMGLatLng는 하나의 위경도 좌표를 나타내는 클래스입니다. lat 속성이 위도를, lng 속성이 경도를 나타냅니다. NMGLatLng의 모든 속성은 생성자로만 지정할 수 있고, 한 번 생성된 객체의 속성은 변경할 수 없습니다.
다음은 NMGLatLng 객체를 생성하고 콘솔에 위도와 경도를 출력하는 예제입니다.


    Swift
    Objective-C




        let coord = NMGLatLng(lat: 37.5670135, lng: 126.9783740)

print("위도: \(coord.lat), 경도: \(coord.lng)")





        Swift

          let coord = NMGLatLng(lat: 37.5670135, lng: 126.9783740)

print("위도: \(coord.lat), 경도: \(coord.lng)")




        Objective-C

          NMGLatLng *coord = NMGLatLngMake(37.5670135, 126.9783740);

NSLog(@"위도: %f, 경도: %f", coord.lat, coord.lng);






다른 좌표계
네이버 지도 SDK는 NMGLatLng 외에도 몇 가지 자주 사용되는 좌표계를 제공합니다. 지원하는 좌표계는 다음과 같습니다.

WebMercatorCoord: 웹 메르카토르 좌표계의 좌표를 의미합니다.
Utmk: UTM-K 좌표계의 좌표를 의미합니다.
Tm128: TM-128 좌표계의 좌표를 의미합니다.

각 클래스의 -toLatLng 메서드를 사용해 다른 좌표를 위경도 좌표로 변환하거나, NMGLatLng를 파라메터로 받는 생성자를 사용해 위경도 좌표를 해당하는 좌표로 변환할 수 있습니다.
다음은 NMGUtmk를 NMGLatLng로 변환하는 예제입니다.


    Swift
    Objective-C




        let utmk = NMGUtmk(x: 953935.5, y: 1952044.1)
let latLng = utmk.toLatLng()





        Swift

          let utmk = NMGUtmk(x: 953935.5, y: 1952044.1)
let latLng = utmk.toLatLng()




        Objective-C

          NMGUtmk *utmk = NMGUtmkMake(953935.5, 1952044.1);
NMGLatLng *latLng = utmk.toLatLng();






다음은 NMGLatLng를 NMGUtmk로 변환하는 예제입니다.


    Swift
    Objective-C




        let latLng = NMGLatLng(lat: 37.5666103, lng: 126.9783882)
let utmk = NMGUtmk(from: latLng)





        Swift

          let latLng = NMGLatLng(lat: 37.5666103, lng: 126.9783882)
let utmk = NMGUtmk(from: latLng)




        Objective-C

          NMGLatLng *latLng = NMGLatLngMake(37.5666103, 126.9783882);
NMGUtmk *utmk = [NMGUtmk utmkFromLatLng:latlng];






MBR
각각 남서쪽과 북동쪽 꼭지점을 의미하는 두 개의 좌표가 주어진다면 직사각형 형태의 영역을 만들 수 있습니다. 이를 최소 경계 사각형 또는 MBR(Minimum Bounding Rectangle)이라고 부릅니다. MBR은 하나의 영역을 나타내는 가장 간단한 방법이므로 영역을 다루는 API에서 자주 사용됩니다.
NMGLatLngBounds
NMGLatLngBounds는 위경도 좌표로 이루어진 하나의 MBR을 나타내는 클래스입니다. southWest 속성이 남서쪽 좌표를, northEast 속성이 북동쪽 좌표를 나타냅니다. NMGLatLngBounds의 모든 속성은 readonly이므로 각 속성은 생성자로만 지정할 수 있고, 한 번 생성된 객체의 속성은 변경할 수 없습니다.
다음은 NMGLatLngBounds 객체를 생성하는 예제입니다.


    Swift
    Objective-C




        let southWest = NMGLatLng(lat: 31.43, lng: 122.37)
let northEast = NMGLatLng(lat: 44.35, lng: 132)
let bounds = NMGLatLngBounds(southWest: southWest, northEast: northEast)





        Swift

          let southWest = NMGLatLng(lat: 31.43, lng: 122.37)
let northEast = NMGLatLng(lat: 44.35, lng: 132)
let bounds = NMGLatLngBounds(southWest: southWest, northEast: northEast)




        Objective-C

          NMGLatLng *southWest = NMGLatLngMake(31.43, 122.37);
NMGLatLng *northEast = NMGLatLngMake(44.35, 132);
NMGLatLngBounds *bounds = [NMGLatLngBounds latLngBoundsSouthWest:southWest northEast:northEast];

3-1.html.body:
카메라와 투영
네이버 지도 SDK는 기기 화면 건너편의 지도를 카메라로 바라보는 방식으로 지도를 표현합니다. 카메라를 이동, 확대 및 축소, 기울임, 회전시킴으로써 화면에 보이는 지도를 자유자재로 움직일 수 있습니다.
카메라의 위치
카메라의 위치는 카메라가 놓여 있는 대상 지점의 좌표와 줌 레벨, 기울기, 베어링으로 구성됩니다. NMFCameraPosition은 카메라의 위치를 나타내는 클래스입니다. NMFCameraPosition의 모든 속성은 readonly이므로 생성자로만 지정할 수 있고, 한 번 생성된 객체의 속성은 변경할 수 없습니다.
다음은 NMFCameraPosition 객체를 생성하는 예제입니다.


    Swift
    Objective-C




        let cameraPosition = NMFCameraPosition()





        Swift

          let cameraPosition = NMFCameraPosition()




        Objective-C

          NMFCameraPosition *cameraPosition = [NMFCameraPosition new];






대상 지점
target은 카메라가 놓여 있는 대상 지점의 좌표를 나타내는 속성입니다. 대상 지점이 변경되면 지도가 동서남북으로 움직입니다.

줌 레벨
zoom은 카메라의 줌 레벨을 나타내는 속성입니다. 줌 레벨은 지도의 축척을 나타냅니다. 즉, 줌 레벨이 작을수록 지도가 축소되고 클수록 확대됩니다. 줌 레벨이 커지면 지도에 나타나는 정보도 더욱 세밀해집니다.
기울임 각도
tilt는 카메라의 기울임 각도를 나타내는 속성입니다. 카메라는 기울임 각도만큼 지면을 비스듬하게 내려다봅니다. 기울임 각도가 0도이면 카메라가 지면을 수직으로 내려다보며, 각도가 증가하면 카메라의 시선도 점점 수평에 가깝게 기울어집니다. 따라서 기울임 각도가 클수록 더 먼 곳을 볼 수 있게 됩니다. 카메라가 기울어지면 화면에 보이는 지도에 원근감이 적용됩니다. 즉, 화면의 중심을 기준으로 먼 곳은 더 작게 보이고 가까운 곳은 더 크게 보입니다.

헤딩 각도
heading은 카메라의 헤딩 각도를 나타내는 속성입니다. 헤딩은 카메라가 바라보는 방위를 의미합니다. 카메라가 정북 방향을 바라볼 때 헤딩 각도는 0도이며, 시계 방향으로 값이 증가합니다. 즉, 동쪽을 바라볼 때 90도, 남쪽을 바라볼 때 180도가 됩니다.

뷰와 카메라
카메라는 기본적으로 지도 뷰의 중심에 위치합니다. 그러나 콘텐츠 패딩이 지정되면 카메라의 위치에 영향을 미칩니다.
카메라의 현재 위치
NMFMapView.cameraPosition을 호출하면 카메라의 현재 위치를 얻을 수 있습니다.
다음은 카메라의 현재 위치를 얻는 예제입니다.


    Swift
    Objective-C




        let cameraPosition = mapView.cameraPosition





        Swift

          let cameraPosition = mapView.cameraPosition




        Objective-C

          CameraPosition *cameraPosition = self.mapView.cameraPosition;






콘텐츠 패딩
NMFMapView.contentInset에 UIEdgeInsets 객체로 콘텐츠 패딩을 지정할 수 있습니다. 다음 그림과 같이 UI 요소가 지도의 일부를 덮을 경우, 카메라는 지도 뷰의 중심에 위치하므로 실제로 보이는 지도의 중심과 카메라의 위치가 불일치하게 됩니다.

이 경우 UI 요소에 가려진 영역을 콘텐츠 패딩으로 지정할 수 있습니다. 콘텐츠 패딩을 지정하면 카메라는 콘텐츠 패딩을 제외한 영역의 중심에 위치하게 됩니다.

다음은 아래쪽 콘텐츠 패딩을 200pt로 지정하는 예제입니다.


    Swift
    Objective-C




        mapView.contentInset = UIEdgeInsets(top: 0, left: 0, bottom: 200, right: 0)





        Swift

          mapView.contentInset = UIEdgeInsets(top: 0, left: 0, bottom: 200, right: 0)




        Objective-C

          self.mapView.contentInset = UIEdgeInsetsMake(0, 0, 200, 0);






콘텐츠 패딩을 변경하더라도 눈에 보이는 지도에는 변화가 일어나지 않습니다. 그러나 카메라가 위치할 지도의 중심이 변경되므로 카메라의 위치도 변경됩니다.
투영
화면은 왼쪽 위를 기준점으로 삼는 pt 단위 좌표계를 사용하고, 지도는 지리적 위경도 좌표계를 사용합니다. NMFProjection 클래스의 메서드를 사용하면 화면 좌표와 지도 좌표를 서로 변환할 수 있습니다. NMFProjection 클래스의 인스턴스는 직접 생성할 수 없고 NMFMapView.projection을 호출해 가져와야 합니다.
다음은 NMFProjection 클래스의 인스턴스를 얻는 예제입니다.


    Swift
    Objective-C




        let projection = mapView.projection





        Swift

          let projection = mapView.projection




        Objective-C

          NMFProjection *projection = self.mapView.projection;






화면 좌표와 지도 좌표 간 변환
-latlngFromPoint:를 사용하면 화면 좌표를 지도 좌표로, -pointFromLatLng:를 사용하면 지도 좌표를 화면 좌표로 변환할 수 있습니다.
다음은 화면의 (100, 100) 지점을 지도 좌표로 변환하는 예제입니다.


    Swift
    Objective-C




        let coord = projection.latlng(from: CGPoint(x: 100, y: 100))





        Swift

          let coord = projection.latlng(from: CGPoint(x: 100, y: 100))




        Objective-C

          NMGLatLng *coord = [projection latlngFromPoint:CGPointMake(100, 100)];






다음은 지도의 (37.5666102, 126.9783881) 지점을 화면 좌표로 변환하는 예제입니다.


    Swift
    Objective-C




        let point = projection.point(from: NMGLatLng(lat: 37.5666102, lng: 126.9783881))





        Swift

          let point = projection.point(from: NMGLatLng(lat: 37.5666102, lng: 126.9783881))




        Objective-C

          CGPoint point = [projection pointFromLatLng:NMGLatLngMake(37.5666102, 126.9783881)];






축척
지도는 3차원인 지구의 표면을 2차원으로 표현하는 것이므로 왜곡이 발생합니다. 네이버 지도 SDK는 웹 메르카토르 투영법을 사용해 지구 구체를 평면으로 표현하기 때문에 줌 레벨뿐만 아니라 위도에 따라서도 축척이 달라집니다. metersPerPixel을 사용하면 현재 카메라가 위치한 지점의 축척을 얻을 수 있습니다.
다음은 현재 카메라가 위치한 지점의 축척을 얻는 예제입니다.


    Swift
    Objective-C




        let metersPerPixel = projection.metersPerPixel()





        Swift

          let metersPerPixel = projection.metersPerPixel()




        Objective-C

          CLLocationDistance metersPerPixel = projection.metersPerPixel;






-metersPerPixelAtLatitude:zoom:을 사용하면 현재 카메라의 위치와 무관하게 특정한 위도와 줌 레벨에서의 축척을 구할 수 있습니다.
다음은 다양한 위도와 줌 레벨에서의 축척을 구하는 예제입니다.


    Swift
    Objective-C




        // 적도, 줌 레벨 10
let metersPerPixel1 = projection.metersPerPixel(atLatitude: 0, zoom: 10)

// 위도 35도, 줌 레벨 10: 적도보다 축척이 커짐
let metersPerPixel2 = projection.metersPerPixel(atLatitude: 35, zoom: 10)

// 위도 35도, 줌 레벨 14: 줌 레벨 10보다 축척이 커짐
let metersPerPixel3 = projection.metersPerPixel(atLatitude: 35, zoom: 14)





        Swift

          // 적도, 줌 레벨 10
let metersPerPixel1 = projection.metersPerPixel(atLatitude: 0, zoom: 10)

// 위도 35도, 줌 레벨 10: 적도보다 축척이 커짐
let metersPerPixel2 = projection.metersPerPixel(atLatitude: 35, zoom: 10)

// 위도 35도, 줌 레벨 14: 줌 레벨 10보다 축척이 커짐
let metersPerPixel3 = projection.metersPerPixel(atLatitude: 35, zoom: 14)




        Objective-C

          // 적도, 줌 레벨 10
CLLocationDistance metersPerPixel1 = [projection metersPerPixelAtLatitude:0 zoom:10];

// 위도 35도, 줌 레벨 10: 적도보다 축척이 커짐
CLLocationDistance metersPerPixel2 = [projection metersPerPixelAtLatitude:35 zoom:10];

// 위도 35도, 줌 레벨 14: 줌 레벨 10보다 축척이 커짐
CLLocationDistance metersPerPixel3 = [projection metersPerPixelAtLatitude:35 zoom:14];

3-2.html.body:
카메라 이동
카메라는 API 호출, 사용자의 제스처 등 다양한 방법으로 움직일 수 있습니다. API를 호출해 카메라를 움직이려면 NMFCameraUpdate 객체와 -moveCamera: 메서드를 사용합니다. NMFCameraUpdate의 다양한 속성을 사용해 카메라의 위치, 애니메이션, 콜백 등을 지정할 수 있습니다.
API 호출로 카메라 이동하기
카메라를 움직이려면 먼저 카메라를 어떻게 움직일지를 나타내는 NMFCameraUpdate 객체를 생성해야 합니다. NMFCameraUpdate는 카메라를 이동할 위치, 방법 등을 정의하는 클래스입니다. NMFCameraUpdate 객체는 오직 팩토리 메서드를 이용해서 생성할 수 있으며, NMFCameraUpdate 클래스에 다양한 팩토리 메서드가 정의되어 있습니다. 다음은 몇 가지 팩토리 메서드에 대한 설명입니다.

+cameraUpdateWithPosition:: 카메라의 위치를 지정한 CameraPosition으로 움직입니다.
+cameraUpdateWithScrollTo:: 카메라의 대상 지점을 지정한 좌표로 변경합니다.
+cameraUpdateWithScrollBy:: 카메라의 대상 지점을 지정한 포인트만큼 상하좌우로 이동합니다.
+cameraUpdateWithZoomTo:: 카메라의 줌 레벨을 지정한 값으로 변경합니다.
+cameraUpdateWithFitBounds:: 영역이 온전히 보이는 좌표와 최대 줌 레벨로 카메라의 위치를 변경합니다.

생성한 객체를 파라미터로 삼아 NMFMapView의 -moveCamera:를 호출하면 카메라가 움직입니다.
다음은 대상 지점을 (37.5666102, 126.9783881)로 변경하도록 지정하는 NMFCameraUpdate 객체를 만들고 -moveCamera:를 호출해 카메라를 움직이는 예제입니다.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
[self.mapView moveCamera:cameraUpdate];






애니메이션
생성한 NMFCameraUpdate 객체를 이용해 -moveCamera:를 호출하기 전에 NMFCameraUpdate.animation 속성을 지정하면 카메라 이동에 애니메이션을 적용할 수 있습니다. 애니메이션이 지정되면 일정한 시간 동안 카메라가 목표 지점까지 서서히 움직입니다.
애니메이션 유형
NMFCameraUpdate.animation을 사용하면 카메라 이동에 애니메이션을 적용할 수 있습니다. animation은 애니메이션의 유형을 의미하는 NMFCameraUpdateAnimation 객체를 파라미터로 받습니다. NMFCameraUpdateAnimation 열거형에 나열되어 있는 애니메이션 유형은 다음과 같습니다.

None: 애니메이션 없이 이동합니다. 기본값입니다.
Linear: 일정한 속도로 이동합니다.
EaseIn: 부드럽게 가속하며 이동합니다. 가까운 거리를 이동할 때 적합합니다.
EaseOut: 부드럽게 감속하며 이동합니다. 가까운 거리를 이동할 때 적합합니다.
Fly: 부드럽게 축소됐다가 확대되며 이동합니다. 먼 거리를 이동할 때 적합합니다.

다음은 카메라 이동에 EaseIn 애니메이션을 적용하는 예제입니다.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn
[self.mapView moveCamera:cameraUpdate];






지속 시간
NMFCameraUpdate의 animationDuration 파라미터를 지정하면 애니메이션의 지속 시간을 변경할 수 있습니다. 단, 애니메이션의 유형이 NMFCameraUpdateAnimationNone일 경우 시간은 무시됩니다. 또한 animationDuration이 0일 경우 애니메이션의 유형을 지정하더라도 애니메이션 없이 이동합니다.
다음은 카메라 이동에 Fly 애니메이션을 적용하고 지속 시간을 1초로 지정하는 예제입니다.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 1
mapView.moveCamera(cameraUpdate)





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .fly
cameraUpdate.animationDuration = 1
mapView.moveCamera(cameraUpdate)




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationFly;
cameraUpdate.animationDuration = 1;
[self.mapView moveCamera:cameraUpdate];






지속 시간을 지정하지 않으면 지도의 기본 애니메이션 시간이 적용됩니다. 기본 애니메이션 시간은 NMFMapView의 animationDuration 속성을 사용해 변경할 수 있습니다.
다음은 지도의 기본 애니메이션 시간을 500밀리초로 변경하는 예제입니다.


    Swift
    Objective-C




        mapView.animationDuration = 0.5





        Swift

          mapView.animationDuration = 0.5




        Objective-C

          mapView.animationDuration = 0.5f;






애니메이션 취소
진행 중인 카메라 이동 애니메이션은 다양한 이유로 취소되거나 취소할 수 있습니다. NMFMapView의 -moveCamera:를 호출해 새로운 카메라 이동을 시작하면 이전에 진행 중이던 카메라 이동이 자동으로 취소됩니다.
다음은 지속 시간이 2초인 카메라 애니메이션을 시작하고 1초 후 다른 카메라 이동을 시작해 기존 카메라 애니메이션을 취소하는 예제입니다.


    Swift
    Objective-C




        let coord1 = NMGLatLng(lat: 37.5666102, lng: 126.9783881);
let coord2 = NMGLatLng(lat: 37.57000, lng: 126.97618);

// 2초간 카메라 애니메이션
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1초 후 다른 카메라 이동이 시작되며 기존 카메라 애니메이션이 취소됨
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    let cameraUpdate = NMFCameraUpdate(scrollTo: coord2)
    cameraUpdate.animation = .easeIn
    mapView.moveCamera(cameraUpdate)
}





        Swift

          let coord1 = NMGLatLng(lat: 37.5666102, lng: 126.9783881);
let coord2 = NMGLatLng(lat: 37.57000, lng: 126.97618);

// 2초간 카메라 애니메이션
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1초 후 다른 카메라 이동이 시작되며 기존 카메라 애니메이션이 취소됨
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    let cameraUpdate = NMFCameraUpdate(scrollTo: coord2)
    cameraUpdate.animation = .easeIn
    mapView.moveCamera(cameraUpdate)
}




        Objective-C

          NMGLatLng *coord1 = NMGLatLngMake(37.5666102, 126.9783881);
NMGLatLng *coord2 = NMGLatLngMake(37.57000, 126.97618);

// 2초간 카메라 애니메이션
NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:coord1];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
[self.mapView moveCamera:cameraUpdate];

// 1초 후 다른 카메라 이동이 시작되며 기존 카메라 애니메이션이 취소됨
dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(1.0 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{
    NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:coord2];
    cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
    [self.mapView moveCamera:cameraUpdate];
});






NMFMapView의 -cancelTransitions를 사용해서 명시적으로 카메라 애니메이션을 취소할 수도 있습니다. 호출하면 현재 진행 중인 카메라 애니메이션이 취소되고 카메라가 현재 위치에 멈춥니다. 스톱 제스처가 활성화되어 있다면 사용자가 지도를 탭했을 때에도 동일한 결과가 일어납니다.
다음은 -cancelTransitions를 호출해 카메라 애니메이션을 취소하는 예제입니다.


    Swift
    Objective-C




        // 2초간 카메라 애니메이션
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1초 후 cancelTransitions()가 호출되며 기존 카메라 애니메이션이 취소됨
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    mapView.cancelTransitions()
}





        Swift

          // 2초간 카메라 애니메이션
let cameraUpdate = NMFCameraUpdate(scrollTo: coord1)
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate)

// 1초 후 cancelTransitions()가 호출되며 기존 카메라 애니메이션이 취소됨
DispatchQueue.main.asyncAfter(deadline: .now() + 1) {
    mapView.cancelTransitions()
}




        Objective-C

          // 2초간 카메라 애니메이션
NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:coord1];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
[self.mapView moveCamera:cameraUpdate];

// 1초 후 cancelTransitions()가 호출되며 기존 카메라 애니메이션이 취소됨
dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(1.0 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{
    [self.mapView cancelTransitions];
});






콜백과 이벤트
-moveCamera:대신 -moveCamera:completion:의 completion block을 사용하면 한 번의 카메라 이동에 대한 결과 콜백을 받을 수 있습니다. 또한 NMFMapView에 델리게이트를 등록하면 지도에서 일어나는 모든 카메라 이동에 대한 이벤트를 받을 수 있습니다.
카메라 이동 콜백
-moveCamera:completion:으로 콜백 블록을 구현하면 해당하는 NMFCameraUpdate에 대한 카메라 이동이 완료됐거나 실패했을 때 콜백을 받을 수 있습니다. 카메라 이동에 애니메이션이 지정되어 있고 그 애니메이션이 취소되었을 경우 completion block의 isCancelled 파라미터가 YES, 그 외의 경우에는 NO로 지정됩니다. 즉, 카메라 이동에 애니메이션이 지정되지 않았으면 카메라 이동은 항상 성공적으로 완료된 것으로 간주됩니다.
다음은 카메라 이동 완료 및 실패 시 토스트를 표시하는 콜백을 지정하는 예제입니다.


    Swift
    Objective-C




        let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate) { (isCancelled) in
    if isCancelled {
        print("카메라 이동 취소")
    } else {
        print("카메라 이동 완료")
    }
}





        Swift

          let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
mapView.moveCamera(cameraUpdate) { (isCancelled) in
    if isCancelled {
        print("카메라 이동 취소")
    } else {
        print("카메라 이동 완료")
    }
}




        Objective-C

          NMFCameraUpdate *cameraUpdate = [NMFCameraUpdate cameraUpdateWithScrollTo:NMGLatLngMake(37.5666102, 126.9783881)];
cameraUpdate.animation = NMFCameraUpdateAnimationEaseIn;
cameraUpdate.animationDuration = 2;
[self.mapView moveCamera:cameraUpdate completion:^(bool isCancelled) {
    if (isCancelled) {
        NSLog(@"카메라 이동 취소");
    } else {
        NSLog(@"카메라 이동 완료");
    }
}];






카메라 변경 이벤트
어떤 이유에 의해서건 카메라가 움직이면 카메라 변경 이벤트가 발생합니다. NMFMapView를 사용 중인 뷰 컨트롤러에 NMFMapViewCameraDelegate 프로토콜을 선언하고, -mapView:addCameraDelegate로 등록하면 카메라 변경 이벤트를 받을 수 있습니다. 카메라의 위치가 변경되면 -mapView:cameraIsChangingByReason: 콜백 메서드가 호출됩니다.
카메라 이동이 시작되기 전 호출되는 -mapView:cameraWillChangeByReason:과 이동이 완료된 후 호출되는 -mapView:cameraDidChangeByReason:에는 reason과 animated 파라미터가 전달됩니다. reason은 이벤트를 발생시킨 카메라 이동의 원인입니다. NMFCameraUpdate.reason을 이용해 카메라 이동의 원인을 지정할 수 있으며, 이벤트 리스너 내에서 이 값을 이용해 어떤 원인에 의해 발생한 이벤트인지 판단할 수 있습니다. 제스처, 컨트롤 등 네이버 지도 SDK의 내장 기능에 의해 카메라가 이동한 경우 미리 정의된 음숫값으로 설정되며, 개발자가 임의의 양숫값을 지정할 수도 있습니다. 미리 정의되어 있는 원인은 다음과 같습니다.

NMFMapChangedByDeveloper: 개발자가 API를 호출해 카메라가 움직였음을 나타냅니다. 기본값입니다.
NMFMapChangedByGesture: 사용자의 제스처로 인해 카메라가 움직였음을 나타냅니다.
NMFMapChangedByControl: 사용자의 버튼 선택으로 인해 카메라가 움직였음을 나타냅니다.
NMFMapChangedByLocation: 위치 트래킹 기능으로 인해 카메라가 움직였음을 나타냅니다.

다음은 카메라 변경 시 원인을 로깅하는 델리게이트 메서드와 원인을 지정해 카메라를 이동시키는 예제입니다.


    Swift
    Objective-C




        func mapViewRegionIsChanging(_ mapView: NMFMapView, byReason reason: Int) {
    print("카메라 변경 - reason: \(reason)")
}

let cameraUpdate = NMFCameraUpdate(scrollTo: NMGLatLng(lat: 37.5666102, lng: 126.9783881))
cameraUpdate.animation = .easeIn
cameraUpdate.animationDuration = 2
cameraUpdate.reason = 1000

mapView.moveCamera(cameraUpdate)





        Swift

