심벌 탭
네이버 지도 SDK는 지도 심벌을 탭한 경우와 지도 자체를 탭한 경우를 구분합니다. 심벌이 탭되면 -mapView:didTapSymbol: 메서드가 호출되며, 탭된 심벌 객체가 파라미터로 전달됩니다. 심벌 객체로부터 탭된 맵뷰 객체와 캡션 텍스트를 얻을 수 있습니다.
심벌 탭 이벤트는 지도로 전파될 수 있습니다. 이벤트를 지도로 전파하려면 NMFMapView의 -mapView:didTapSymbol:이 NO를 반환하도록 구현해야 합니다. 그렇게 하면 -mapView:didTapSymbol:이 반환된 후 지도의 -mapView:didTapMap:point가 호출됩니다. 반대로 -mapView:didTapSymbol:이 YES를 반환할 경우 심벌이 이벤트를 소비한 것으로 간주되어 지도의 -mapView:didTapMap:point는 호출되지 않습니다.
