지도가 감당할 수 없을 정도로 많은 비트맵이 사용되면 XCode console에 "Overlay image atlas overflow"라는 경고가 로깅되고 렌더링이 무척 느려집니다. 메모리 사용량이 더욱 증가해 시스템이 감당할 수 없을 정도가 되면 OOM(Out of memory)으로 프로세스가 종료될 수 있습니다.
겹침 우선순위
여러 오버레이가 화면에서 겹쳐지면 우선순위가 높은 오버레이가 낮은 오버레이를 덮습니다. 겹침 우선순위는 기본적으로 오버레이의 유형에 따라 지정되지만 변경할 수 있습니다.
전역 Z 인덱스
globalZIndex 속성을 사용하면 겹침 우선순위를 지정할 수 있습니다. globalZIndex가 0 이상이면 심벌 위에, 0 미만이면 심벌 아래에 그려집니다. 단, globalZIndex가 아무리 작더라도 지도 배경보다는 위에 그려집니다. 각 오버레이 유형별 globalZIndex 기본값은 다음과 같습니다.

정보 창: 400000
위치 오버레이: 300000
마커: 200000
화살표 경로 오버레이: 100000
(지도 심벌)
경로선: -100000
셰이프(폴리곤, 폴리라인, 서클): -200000
지상 오버레이: -300000
(지도 배경)

예를 들어 경로선은 기본적으로 셰이프의 위, 지도 심벌의 아래에 그려집니다. 그러나 경로선의 globalZIndex를 250000으로 지정하면 마커의 위, 위치 오버레이의 아래에 그려집니다.
다음은 세 오버레이의 겹침 우선순위를 폴리곤 -> 경로선 -> 마커 순으로 지정하는 예제입니다. 


    Swift
    Objective-C




        polygon.globalZIndex = 150000
path.globalZIndex = 50000
marker.globalZIndex = -500000





        Swift

          polygon.globalZIndex = 150000
path.globalZIndex = 50000
marker.globalZIndex = -500000




        Objective-C

          polygon.globalZIndex = 150000;
path.globalZIndex = 50000;
marker.globalZIndex = -50000;







보조 Z 인덱스
zIndex 속성을 사용하면 globalZIndex가 동일한 오버레이간의 겹침 우선순위를 지정할 수 있습니다. 즉, 두 오버레이의 globalZIndex가 동일하다면 zIndex가 큰 오버레이가 작은 오버레이를 덮습니다. 예를 들어 마커의 zIndex를 1로 지정하고, 지상 오버레이의 zIndex를 2로 지정했다 하더라도 마커의 기본 globalZIndex는 200000, 지상 오버레이의 기본 globalZIndex는 -300000 이므로 마커가 지상 오버레이를 덮습니다. zIndex의 기본값은 오버레이의 유형과 무관하게 0이므로, 동일한 유형의 오버레이간의 우선순위만을 지정하고자 하는 경우 globalZIndex보다 직관적으로 사용할 수 있습니다.
다음은 세 마커의 노출 순서를 노란색 -> 녹색 -> 파란색 순으로 지정하는 예제입니다. 


    Swift
    Objective-C




        yellowMarker.zIndex = 100
greenMarker.zIndex = 0
blueMarker.zIndex = -10





