노출 제어
모든 오버레이에는 가시성, 최소 및 최대 줌 레벨에 대한 속성이 있습니다. 오버레이를 일시적으로 또는 특정한 상황에만 숨기고자 할 경우 mapView 속성을 변경하는 것보다 이러한 속성을 사용하면 효율적입니다.
가시성
hidden 속성을 YES로 지정하면 오버레이가 화면에서 숨겨집니다. 그러나 오버레이와 지도 간의 관계는 여전히 유지됩니다.
다음은 오버레이를 숨기는 예제입니다.


    Swift
    Objective-C




        overlay.hidden = true





        Swift

          overlay.hidden = true




        Objective-C

          overlay.hidden = YES;






최소 및 최대 줌 레벨
minZoom 및 maxZoom 속성을 이용하면 특정 줌 레벨에서만 오버레이가 나타나도록 지정할 수도 있습니다. 카메라의 줌 레벨이 minZoom과 maxZoom 범위를 벗어나면 오버레이가 숨겨집니다. isMinZoomInclusive 및 isMaxZoomInclusive 속성을 이용하면 최소/최대 줌 레벨에서 오버레이가 나타날지 여부를 지정할 수도 있습니다. 예를 들어 minZoom이 15이고 지도의 줌 레벨도 15일 때, isMinZoomInclusive가 YES라면 오버레이가 나타나고 NO라면 나타나지 않습니다. 
다음은 오버레이가 12~16 레벨 사이에서만 나타나도록 지정하는 예제입니다.


