최대 화면 거리 제한
모든 노드에 대해 모든 인접 노드를 대상으로 클러스터링을 시도하면 시간복잡도가 기하급수적으로 증가하여 성능에 큰 악영향을 미칩니다. 때문에 화면상 거리를 기준으로 삼아 후보 노드에 대한 탐색 공간을 제한할 수 있습니다.
maxScreenDistance 프로퍼티를 사용해 클러스터링할 최대 화면 거리를 지정할 수 있습니다. 즉, 두 노드 node1과 node2가 있을 때, zoom 줌 레벨에서 두 노드의 화면상 거리가 이 값보다 크다면, NMCDistanceStrategy.getDistance:Node1:Node2:가 NMCThresholdStrategy.getThreshold:보다 작거나 같더라도 node1과 node2는 클러스터링되지 않습니다.
따라서 NMCThresholdStrategy와 NMCDistanceStrategy를 지정했다면 전략을 고려해 최적의 거리를 지정해야 합니다. 값을 너무 작게 지정하면 클러스터링되어야 하는 노드가 클러스터링되지 않을 수 있고, 너무 크게 지정하면 성능이 저하됩니다.
